  "text" : "\uBC15\uC528 \uB530\uB77C\uAC00\uB294 \uC5B8\uB860\uC0AC \uC0DD\uC911\uACC4 \uBCF4\uACE0 \uC788\uB294\uB370, \uC5B8\uB860\uC0AC \uCDE8\uC7AC\uCC28\uB7C9\uB4E4 \uC644\uC804 \uBB34\uBC95\uC774\uB124\u2026 \uC624\uD1A0\uBC14\uC774\uB098 \uCC28\uB7C9\uC73C\uB85C \uB530\uB77C\uAC00\uBA74\uC11C \uC65C \uBC84\uC2A4\uC804\uC6A9\uCC28\uB85C\uB97C \uB118\uB098\uB4E4\uACE0, \uCC28\uC120\uC774\uB098 \uC2E0\uD638\uC704\uBC18\uC744 \uC218\uC2DC\uB85C \uD574. \uACBD\uCC30 \uACBD\uD638\uCC28\uB7C9\uC774 \uAC70\uAE30\uB85C \uAC04\uB2E4\uACE0, \uCDE8\uC7AC\uCC28\uB7C9\uC774 \uADF8 \uB8E8\uD2B8\uB97C \uB611\uAC19\uC774 \uB530\uB77C\uAC00\uBA74 \uC548\uB418\uC9C0 \uC54A\uB098;",
