  "text" : "\uC5B4 \uC124\uB9C8 \uC11D\uC0AC\uD559\uC704\uB17C\uBB38\uB3C4 \uC544\uB2C8\uACE0, \uC0AC\uC5C5 \uC218\uC900\uC758 \uADDC\uBAA8\uAC00 \uC788\uB294 \uC5F0\uAD6C \uBCF4\uACE0\uC11C\uB97C \uC800\uC790\uAC00 \uC804\uBD80 \uB2E4 \uB3C4\uB9E1\uC544\uC11C \uBD84\uC11D\uD558\uACE0 \uC4F4\uB2E4\uACE0 \uC54C\uACE0 \uACC4\uC2DC\uB294 \uAC83\uC740 \uC544\uB2C8\uC8E0\u2026? \uAC70\uAE30\uC5D0 \uAF64 \uB9CE\uC740 \uC0AC\uB78C\uB4E4\uC774 \uCC38\uC5EC\uD569\uB2C8\uB2E4. \uB300\uD559\uC758 \uACBD\uC6B0\uC5D0\uB294 \uB300\uD559\uC6D0\uC0DD \uC870\uAD50\uB4E4\uC774, \uB3C5\uB9BD \uC5F0\uAD6C\uC18C \uB4F1\uC758 \uACBD\uC6B0\uC5D0\uB294 \uC778\uD134\uB4E4\uC774.",
