  "text" : "\uADF8\uB798\uB193\uACE0\uB294 \uB2F9\uB2F9\uD558\uAC8C \"\uBBF8 \uAD6D\uBB34\uBD80\uC640 \uD55C\uAD6D \uD615\uC0AC\uC815\uCC45\uC5F0\uAD6C\uC6D0\uC774 \uBC1D\uD614\uC2B5\uB2C8\uB2E4.\"\uC2DD\uC73C\uB85C \uB808\uD37C\uB7F0\uC2A4\uB97C \uBC1D\uD788\uC9C0\uB9CC, \uADF8 \uB808\uD37C\uB7F0\uC2A4\uB4E4\uC5D0\uB294 \uADF8\uB7F0 \uB0B4\uC6A9 \uC5C6\uB2E4. \uD574\uB2F9 \uB808\uD37C\uB7F0\uC2A4\uB4E4\uC740 '\uD55C\uAD6D\uB0A8\uC131\uC740 \uB3D9\uB0A8\uC544 \uC544\uB3D9\uC131\uB9E4\uB9E4 \uAD00\uAD11\uC758 \uC8FC\uC694 \uC218\uC694\uC790\/\uACE0\uAC1D\uC73C\uB85C \uC9C0\uBAA9\uB418\uACE0 \uC788\uB2E4'\uB294 \uC815\uB3C4\uB85C\uB9CC \uC9C0\uC801\uD558\uACE0 \uC788\uC74C.",
