  "text" : "\uC5B4\uB9B4 \uB54C\uC5D0\uB294 \uB3D9\uB124\uC5D0 \uD568\uAED8 \uB180 \uB0B4 \uB610\uB798 \uC544\uC774\uB4E4\uC774 \uAC70\uC758 \uC5C6\uC5C8\uACE0, \uBD80\uBAA8\uB2D8\uAED8\uC11C TV\uB3C4 \uBABB\uBCF4\uAC8C \uD558\uC154\uC11C \uD559\uAD50 \uB2E4\uB140\uC624\uBA74 \uADF8\uC800 \uC190\uC5D0 \uC7A1\uD788\uB294\uB300\uB85C \uCC45\uB9CC \uC77D\uC74C. \uADF8\uB7EC\uB2E4\uBCF4\uB2C8 \uB098 \uD63C\uC790\uC11C \uC18D\uB3C5\uD558\uB294 \uBC95\uC744 \uBC30\uC6B0\uAC8C \uB418\uB354\uB77C. \uBABB\uD574\uB3C4 \uD55C \uB2EC\uC5D0 \uB300\uCDA9 100\uAD8C \uC815\uB3C4\uC529\uC740 \uC77D\uC5C8\uB358 \uAC83 \uAC19\uC740\uB370\u2026",
